import { StyleSheet } from "react-native";

export default StyleSheet.create({
    page: {
        display: 'flex',
        flexDirection: 'row',
        flex: 1,
        alignItems: 'center',
    },
    input: {
        borderWidth: 1,
        borderColor: 'black'
    },
    btn: {
        borderColor: 'black',
        borderWidth: 2,
    }
})
